import ContumazHead from '../components/contumaz_head';
import ContumazAside from '../components/contumaz_aside';

function Post() {
    return (
      <div>
        <ContumazHead/>
        <body>
          <div>
            <ContumazAside/>
            <h1 id='post-title'>
              Degradação ambiental e exclusão  social
            </h1>
            <h2>Subtitle</h2>
            <p>Date</p>
            <p>Text</p>
            <p>Autor</p>
          </div>
        </body>
      </div>
    );
}
export default Post;
